import React from 'react';
import NavbarTop from '../navbar/NavbarTop';
import Footer from '../Footer';

function SelectSpace() {
  return (
    <div>
      <NavbarTop></NavbarTop>
      <div>
        <h1>이용장소 선택</h1>
      </div>
      <Footer />
    </div>
  );
}

export default SelectSpace;
